import { useState } from 'react';
import './App.css';

function App() {
  const [value,setValue]=useState(0)
  const outputArray=(value)=>{
    for(let i=1;i<=value;i++){
      alert(i)
      if(i%5===0 && i%3===0){
         alert(i)
      }
      else if(i%5===0 ){
        return<h1>Buzz</h1>
      }
      else if( i%3===0){
        return<h1>Fizz</h1>
      }
      else{
        return<h1>{String(i)}</h1>
      }
    }
  }
  return (
    <div className="App">
      <input onKeyUp={(e)=>setValue((e.target.value))}/>
      <input type='submit' value='submit' onClick={()=>outputArray(value)}/>
      {value}
    </div>
  );
}

export default App;
